    <pre><textarea class="page-source" readonly>desc: &#39;Un disco de vinilo de 1970 que al reproducirlo en un tocadiscos reproduce música actual ya sea de bandas hasta videojuegos, el genero de la música varia desde el jazz hasta electrónica(incluyendo combinaciones de genero) independientemente que fuera lanzada en físico o digital parece auto-actualizarse.&#39;
date: &#39;30-06-2007 &#39;
loc: &#39;Tienda de música en █████████,Mexico.&#39;
sec: &#39;Sala de descanso del laboratorio de ███████ del Sitio- ██,Se compro un tocadiscos para reproducirlo.&#39;
note: &#39;Es entre curioso y raro, pero al mismo tiempo agradable no sabes que música puede salir se ha intentado 80 veces que salga una canción con resultado negativo, lo bueno es que las cámaras tienen audio al igual que los teléfonos inteligentes reconocen canciones.- Dra. Lucero &#39;
a-note: &#39;Se creía que solo podía reproducir música de bandas hasta que salió &#34;Moon Lord&#34; del videojuego terraria.&#39;
